INSERT INTO `cms_contents` (`id`, `cms_type`, `title`, `description`, `image`, `status`, `type`, `created_by`, `modified_by`, `created`, `modified`) VALUES
(1, '3', 'About Us', '<p>Jyotish is the most time  tested system of astrology in the world. The Sanskrit word is rooted in jyoti which means light as the light of knowledge. Jyotish signifies the Science of Light. In western countries, Jyotish knowledge can be traced back to the vedic civilization in northern Bharat (India). Indeed, Jyotish is a part of the Vedic scriptures  many manuscripts and translations of which are avail..</p>', '8598_4.jpg', 'Active', 'All', 0, 0, '2018-03-27 12:16:13', '2019-03-09 09:55:49'),
(2, '1', 'Mission', '<p>Serving the students from the socially disadvantaged section of the society. Our dream is to nurture this institution as a center of modern studies in both JYOTISH Science and Humanities. We do not wish to compromise with the basis task of making a new man who combines in his character a thirst for knowledge and a deep attachment to his culture roots.</p>\r\n\r\n<p></p>', '535_mark_right.jpeg', 'Active', 'All', 0, 0, '2018-03-27 12:19:15', '2019-03-09 09:51:41'),
(3, '2', 'Vision', '<p>This is because while they may have theoretical knowledge of scriptural or philosophical principles, they cannot understand the meaning and timing of the actual events in their own and others lives. However this knowledge is easily attainable by even a neophyte student of Jyotish. Jyotish or astrology is considered the eye of the Vedas. Just as a blind person cannot walk or perform many other ordinary tasks, one who studies the Vedic literatures but does not know Jyotish may have theoretical knowledge, but will be handicapped in the practical realization of Vedic truth.</p>', '535_mark_right.jpeg', 'Active', 'All', 0, 0, '2018-03-27 12:25:13', '2019-03-09 09:52:10'),
(4, '4', 'Purpose', '<p>Jyotish is meant to be understood in the theistic context of Vedic knowledge, especially the cosmological understanding of creation, maintenance and destruction of the manifest universe as acts of God. When we see everything in its proper spiritual value and relationship with God, we see correctly. If we lose this context or situational awareness, then no matter how much knowledge we possess, we are in illusion because we will falsely ascribe these phenomena to some material cause. Therefore, if we try to apply Jyotish only to making predictions about a persons material life.</p>', '', 'Active', 'All', 1, 0, '2018-12-08 05:50:07', '2019-03-09 09:52:28'),
(5, '5', 'Newsletter', '<p>Astrology is the study of the movements and relative positions of celestial objects as a means of divining information about human affairs and terrestrial events.</p>', '', 'Active', 'All', 1, 0, '2019-03-18 00:00:00', '2019-05-25 17:24:33'),
(6, '6', 'Declaration', 'jyotish vishwa visyapeeth is an autonomous institute and does not resembles to UGC. Also it is declared that the certificate issued from jyotish vishwa visyapeeth is accrediate to IAO (International Accrediation Organisation) and not valid to any Government approved University and government jobs. By submitting this form I accept the terms & conditions set for jyotish vishwa visyapeeth Registration, Viva and Certification. I have read and understand above policies and agreed for registration. ', '', 'Active', 'All', 1, 0, '2019-03-18 00:00:00', '2019-03-09 09:53:30');
