(1, 'addmission_form', 'addmission_form', '<div>\r\n\r\n<style>\r\n.ast_toppadder70\r\n{\r\n	padding-top:70px;\r\n}\r\n.ast_bottompadder70\r\n{\r\n	padding-bottom:70px;\r\n}\r\n\r\n.signcol\r\n{\r\n	text-align: center;\r\n    text-transform: capitalize;\r\n    font-weight: bold;\r\n   	padding-left: 4%;\r\n}\r\n.texton\r\n{\r\n    font-family:\"Arial\", Times, sans-serif;\r\n	font-size: 15px;\r\n	border:none;\r\n	resize: none;\r\n	margin-top: 10px;\r\n	margin-left: 4%; \r\n	width: 90%;\r\n	color: #555;\r\n	text-align: justify;\r\n}	\r\n	/* print preview table css*/\r\n.prev\r\n{\r\n    margin-left:auto; \r\n    margin-right:auto;\r\n     /* text-align: center; */\r\n    width: 70%;\r\n    margin-top: 100px;\r\n    font-family:\"Arial\", Times, sans-serif;\r\n    border: outset;\r\n}\r\n	.prev2{\r\n	    margin-left:auto; \r\n	    margin-right:auto;\r\n	    width: 100%;\r\n	    font-family:\"Arial\", Times, sans-serif;\r\n	    /* //border: outset; */\r\n	}\r\n	.prev1{\r\n	    margin-left:auto; \r\n	    margin-right:auto;\r\n	   /*  text-align: center; */\r\n	    width: 100%;\r\n	    font-family:\"Arial\", Times, sans-serif;\r\n	}\r\n	.head{\r\n	    text-align: center;\r\n	    font-size: 22px;\r\n	    font-weight: bold;\r\n	    text-transform: uppercase;\r\n	}\r\n	.title_sw{\r\n	    text-align: center;\r\n	}\r\n	.accrediate{\r\n	    text-align: center;\r\n	    font-size: 30px;\r\n	    font-weight: bold;\r\n	    text-transform: capitalize;\r\n	}\r\n	.locate{\r\n	    text-align: center;\r\n	    text-transform: capitalize;\r\n	    font-weight: bold;\r\n	}\r\n	.locate1{\r\n	    text-align: center;\r\n	    font-weight: bold;\r\n	}\r\n	.mail{\r\n		/*width:100%; */\r\n	    text-align: center;\r\n	    padding-top: 4px;\r\n	    padding-bottom: 4px;\r\n	    font-size: 15px;\r\n	    border-bottom: solid thin; \r\n	    border-top: solid thin;\r\n	}\r\n	.thead{\r\n	    text-align: center;\r\n	    background-color:#DCDCDC;\r\n	    font-family: \"Times New Roman\", Times, serif;\r\n	