d>\r\n					</tr>\r\n					<tr>\r\n						<td  class=\"title_sw\">\r\n							<span class=\"locate\">Address :</span> {company_address}\r\n						</td>\r\n					</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n			<td></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<table class=\"prev2\" align=\"center\">\r\n				<tbody>\r\n				<tr>\r\n					<td class=\"mail\">			\r\n							<span class=\"locate\">E-mail :</span> {company_email}\r\n					</td>\r\n				</tr>\r\n				<tr class=\"thead\">\r\n					<td>\r\n						Admission form\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td  class=\"desc\"><span class=\"reg-img\"><img src=\"{user_image}\" width=\"120px\" height=\"150px\"></span><br><br>\r\n						<span><b style=\"font-size:18px;\">Name of the exam you want to appear</b></span><br><br>\r\n						<span style=\"margin-bottom: 15px;margin-top: 10px;\" class=\"under_color\">{exam_name}</span><br><br>\r\n						1. <span class=\"locate\" >Candidate Name :</span> (Name appears on your certificate is as given below)<br><br>\r\n						<span style=\"margin-bottom: 15px;margin-top: 10px;\" class=\"under_color\">{full_name}</span><br><br>\r\n						<span class=\"sublabel locate\">First Name :</span> <span style=\"width:40%\" class=\"under_color\">{first_name}</span><br><br>\r\n						<span class=\"sublabel locate\">Middle Name :</span><span style=\"width: 38%\" class=\"under_color\">{middel_name}</span><br><br>\r\n						<span class=\"sublabel locate\">Last/Family Name :</span><span  style=\"width: 34%; margin-right: 10%\" class=\"under_color\">{last_name}</span> \r\n						<span class=\"locate\">Gender : </span><span class=\"under_color\">{gender}</span> <br><br>\r\n						2.\r\n						<span class=\"locate\" >Date of Birth (DD/MM/YYYY) :</span>\r\n						<span class=\"under_color\">{dob}</span><br><br>\r\n						<label class=\"demo\">The following demographic information not required, but all information is appreciated.</label><br><br>\r\n						3. <span class=\"locate\">address :</span>\r\n							<span style=\"width: 87%\" class=\"under_color\">{address}</span><br><br>\r\n						<span class=\"locate\">Postal code : </span>\r\n							<span style=\"width: 20%\" class=\"under_color\">{pin_code}</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n						<span class=\"locate\">City : </span>\r\n							<span style=\"width: 20%\" class=\"under_color\">{city_name}</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n						<span class=\"locate\">State/Province/country : </span>\r\n							<span style=\"width: 21%\" class=\"under_color\">{state_name}</span><br><br>\r\n						4. <span class=\"locate\"> E-mail ID : </span>\r\n							<span style=\"width: 50%\" class=\"under_color\">{email_id}</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n							<span class=\"locate\">Contact :</span> <span style=\"width: 28%\" class=\"under_color\">{mobile_no}</span><br><br>\r\n						5. <span class=\"locate\">Education : </span>\r\n							<span style=\"width: 85%\" class=\"under_color\">{education}</span><br><br>\r\n						6. <span class=\"locate\">occupation/job title :</span>\r\n							<span style=\"width: 76%\" class=\"under_color\">{occupation}</span> <br><br>\r\n						7. 	<span class=\"locate1\"> How did you first hear about Jyotish Vishwa Vidyapeeth ? (Please choose one)</span><br><br>\r\n							<span style=\"width:26%\" class=\"under_color\">{how_u_know}</span><br><br>\r\n					</td>\r\n				</tr>	\r\n				<tr>\r\n					<td>--------------------------------------------------------------------------------------------------------------------------------------------------------------------\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<span class=\"declws\">declaration / affirmation :</span><br>\r\n						<p style=\"text-align:justify;margin:20px;font-size:13px !important\">\r\n					    {declaration}\r\n					    </p><br><br><br>\r\n					</td>\r\n				</tr>\r\n				<!-- <tr>\r\n					<td>\r\n						<span class=\"declws\">affirmation :</span><br><br>\r\n	