(4, 'order_place_vendor', '{product_forex} Order No. {order_no}', '<!DOCTYPE html>\r\n<html>\r\n  <head>\r\n    <title>Invoice</title>\r\n  </head>\r\n  <body>\r\n    <style type=\"text/css\">\r\n      th\r\n      {\r\n        text-align:left;\r\n      }\r\n      body\r\n      {\r\n        background-color: #EDEEF0;\r\n        font-size: 13px;\r\n      }\r\n      .order_td\r\n      {\r\n        border-bottom:1px solid #000;\r\n      }\r\n      .order_td1\r\n      {\r\n        border-right:1px solid #000;\r\n      }\r\n      .detail_id\r\n      {\r\n        border-top:1px solid #000;\r\n        border-bottom:1px solid #000;\r\n      }\r\n      .detail_head\r\n      {\r\n        text-align:right;\r\n        font-weight:bold;\r\n      }\r\n    </style>\r\n     \r\n   <table cellpadding=\"0px\" cellspacing=\"0px\" width=\"80%\" align=\"center\" border=\"1\" style=\"background-color:#fff;\">\r\n    <tr>\r\n      <td>\r\n        <table cellpadding=\"10px\" cellspacing=\"0px\" width=\"100%\" border=\"0\">\r\n          <tr>\r\n            <td colspan=\"2\" style=\"text-align:center;background-color:#000;color:#fff;padding:0px\"><h3><img align=\"left\" alt=\"logo\" border=\"0\" src=\"{logo}\" width=\"50px\" /></h3></td>\r\n          </tr>\r\n          <tr>\r\n            <td colspan=\"2\" style=\"vertical-align:top;\">\r\n              <table cellpadding=\"10px\" cellspacing=\"0px\" width=\"100%\" border=\"0\">\r\n                <thead>\r\n                  <tr>\r\n                    <th colspan=\"4\" style=\"border-bottom:1px solid #000;font-size:16px;\"><b>Customer Details</b></th>\r\n\r\n                  </tr>\r\n                </thead>\r\n                <tbody>\r\n                  <tr>\r\n                    <td><b>Name :-</b> {name}</td>\r\n                    <td><b>Mobile :-</b> {mobile}</td>\r\n                    <td><b>Email :-</b> {email}</td>\r\n                    <td><b>Date Of Birth :-</b> {dob}</td>\r\n                </tr>\r\n                <tr>\r\n  