\r\n                  <tr>\r\n                    <th colspan=\"4\" style=\"border-bottom:1px solid #000;font-size:16px;\"><b>Beneficiary Details</b></th>\r\n\r\n                  </tr>\r\n                </thead>\r\n                <tbody>\r\n                  <tr>\r\n                    <td><b>Beneficiary Name :-</b> {beneficiary_name}</td>\r\n                    <td><b>Account No :-</b> {be_account_no}</td>\r\n                    <td><b>Beneficiary Address. :-</b> {beneficiary_address}</td>\r\n                    <td><b>Bank Name :-</b> {be_ank_name}</td>\r\n                </tr>\r\n                <tr>\r\n                    <td><b>Bank Address :-</b> {be_bank_address}</td>\r\n                  </tr>\r\n                </tbody>\r\n               \r\n              </table>\r\n              \r\n            </td>\r\n            </tr>\r\n            <tr>\r\n            <td style=\"vertical-align:top;\">\r\n              <table cellpadding=\"10px\" cellspacing=\"0px\" width=\"100%\" border=\"0\">\r\n                <thead>\r\n                   <tr>\r\n                   <th colspan=\"4\" style=\"border-bottom:1px solid #000;font-size:16px;\"><b>Order Details</b></th>\r\n                  </tr>\r\n                </thead>\r\n                <tbody>\r\n                  <tr style=\"\">\r\n                    <td style=\"\">\r\n                      <b>Transaction Payment ID.-</b>\r\n                        {trans_payment_id}\r\n                    </td>\r\n                    <td style=\"\">\r\n                      <b>Transaction Reference No.-</b>\r\n                        {trans_reference_no}\r\n                    </td>\r\n                    \r\n                    <td style=\"\">\r\n                      <b>Order Date -</b>\r\n                        {order_date}\r\n                    </td>\r\n                    <td style=\"\">\r\n                      <b>Date - </b>\r\n                       {date}\r\n                    </td>\r\n                  </tr>\r\n\