          <b>Additional Charge</b>\r\n                  </td>\r\n                  <td style=\"border-bottom:1px solid #000;border-bottom:1px solid #000;\">\r\n                    Rs. {add_charge} &nbsp;+&nbsp;&nbsp; {add_gst} (18% GST)\r\n                  </td>\r\n                </tr>\r\n                <tr>\r\n                <tr>\r\n                  <td style=\"border-bottom:1px solid #000;border-bottom:1px solid #000;\" >\r\n                    <b>Payable Amount</b>\r\n                  </td>\r\n                  <td style=\"border-bottom:1px solid #000;border-bottom:1px solid #000;\">\r\n                   <b><span style=\"color: red\">Rs. {payable_amt} </span></b>\r\n                  </td>\r\n                </tr>\r\n                <tr>\r\n                  <td colspan=\"5\">\r\n                    Amount chargable (in words)\r\n                    <p><b>INR {amount_in_words} </b></p>\r\n                  </td>\r\n                </tr>\r\n                <!-- <tr>\r\n                  <td colspan=\"6\">\r\n                    <b> Terms & Conditions </b>\r\n                    <p>  {terms}</p>\r\n                  </td>\r\n                </tr> -->\r\n            <!-- <tr>\r\n              <td colspan=\"6\" align=\"center\" style=\"height:30px; color:#FFFFFF; font-size:20px;  font-family: Arial, Helvetica, sans-serif;  font-weight:bold; vertical-align:middle;\" width=\"217\">\r\n              <p align=\"center\" style=\"font-family:Arial, Helvetica, sans-serif; font-size: 35px; color:#4c4c4c;\">Place Your Order On The Go!</p>\r\n              <a href=\"https://play.google.com/store/apps/details?id=tbsind.lifehardin&amp;hl=en\" target=\"_blank\"><img alt=\"android\" src=\"{android}\" style=\"height:40px;\" /></a>\r\n              </td>\r\n            </tr> -->\r\n                <tr>\r\n                  <td colspan=\"6\">\r\n                   <center>This is computer generated invoice.</center>\r\n                  </td>\r\n                </tr>\r\n      