(5, 'booking_slip', 'Thank you for booking in adarsh driving school', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n	<title>Invoice</title>\r\n</head>\r\n<body style=\"border: 1px solid #000;width: 50%\">\r\n	<table cellpadding=\"4px\" cellspacing=\"0px\" border=\"0px\">\r\n		<thead>\r\n			<tr>\r\n				<th colspan=\"1\" style=\"text-align: center;\">\r\n					<img src=\"{logo}\" width=\"100px\">\r\n				</th>\r\n				<th style=\"text-align: center;\">\r\n					<span style=\"font-weight: bold;text-transform: uppercase;font-size: 20px;\">{company_name}</span><br>\r\n					Address : {address_company}<br>\r\n					Call No: {company_mobile}\r\n				</th>\r\n				<th colspan=\"2\" style=\"text-align: center;\">\r\n					<table>\r\n						<tbody>\r\n							<tr>\r\n								<td style=\"text-align: left;\">No. {slip_no_rand}</td>\r\n							</tr>\r\n							<tr>\r\n								<td style=\"text-align: left;\">Date: {registration_date}</td>\r\n							</tr>\r\n						</tbody>\r\n					</table>\r\n				</th>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"4\"><hr></td>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td colspan=\"4\">\r\n					<label style=\"font-family: Gill Sans Extrabold, sans-serif;\">Received From : </label> {student_name}<br><br>\r\n				\r\n					<label style=\"font-family: Gill Sans Extrabold, sans-serif;\">Admission No : </label> {adminssion_no}\r\n					<label style=\"font-family: Gill Sans Extrabold, sans-serif;\">Mobile No : </label> {student_mob_no}<br><br>\r\n					<label style=\"font-family: Gill Sans Extrabold, sans-serif;\">The Sum Of Rupess : </label> {amount_in_rupees}<br><br>\r\n					<label style=\"font-family: Gill Sans Extrabold, sans-serif;\">Discription : </label> {description}  \r\n					<label style=\"font-family: Gill Sans Extrabold, sans-serif;\">Type Of Course : </label> {course_type}<br><br>\r\n					<label style=\"font-family: Gill Sans Extrabold, sans-serif;\">Class : </label> {class_type}<br><br>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan=\"2\">\