(6, 'registration_new', 'Thank you for registration in Adarsh Driving School', '\r\n<!---728x90--->\r\n	<style>\r\n.signcol{\r\n	text-align: center;\r\n    text-transform: capitalize;\r\n    font-weight: bold;\r\n   	padding-left: 4%;\r\n}\r\n.texton{\r\n    font-family:\"Arial\", Times, sans-serif;\r\n	font-size: 15px;\r\n	border:none;\r\n	resize: none;\r\n	margin-top: 10px;\r\n	margin-left: 4%; \r\n	width: 90%;\r\n	color: #555;\r\n	text-align: justify;\r\n	}		/* print preview table css*/\r\n.prev{\r\n    margin-left:auto; \r\n    margin-right:auto;\r\n    text-align: center;\r\n    width: 70%;\r\n    margin-top: 100px;\r\n    font-family:\"Arial\", Times, sans-serif;\r\n    border: outset;\r\n}\r\n.prev2{\r\n    margin-left:auto; \r\n    margin-right:auto;\r\n    width: 70%;\r\n    font-family:\"Arial\", Times, sans-serif;\r\n    border: outset;\r\n}\r\n.prev1{\r\n    margin-left:auto; \r\n    margin-right:auto;\r\n    text-align: center;\r\n    width: 100%;\r\n    font-family:\"Arial\", Times, sans-serif;\r\n}\r\n.head{\r\n    text-align: center;\r\n    font-size: 22px;\r\n    font-weight: bold;\r\n    text-transform: uppercase;\r\n}\r\n.title_sw{\r\n    text-align: center;\r\n}\r\n.accrediate{\r\n    text-align: center;\r\n    font-size: 30px;\r\n    font-weight: bold;\r\n    text-transform: capitalize;\r\n}\r\n.locate{\r\n    text-align: center;\r\n    text-transform: capitalize;\r\n    font-weight: bold;\r\n}\r\n.locate1{\r\n    text-align: center;\r\n    font-weight: bold;\r\n}\r\n.mail{\r\n	/*width:100%; */\r\n    text-align: center;\r\n    padding-top: 4px;\r\n    padding-bottom: 4px;\r\n    font-size: 15px;\r\n    border-bottom: solid thin; \r\n    border-top: solid thin;\r\n}\r\n.thead{\r\n    text-align: center;\r\n    background-color:#DCDCDC;\r\n    font-family: \"Times New Roman\", Times, serif;\r\n    font-size: 22px;\r\n    font-weight: bold;\r\n    text-transform: uppercase;\r\n}\r\n.logo_left{\r\n    /*position: absolute;*/\r\n    padding-left: 20px;\r\n    padding-right: 20px;\r\n    width: 150px;\r\n    height: 80px;\r\n    padding-top: 10px;\r\n}\r\n.logo_right{\r\n    /*position: absolute;*/\r\n    padding-left: 20px;\r\n    padding-right: 20px;\r\n    width: 150px;\r\n    height: 120px;\r\n    padding-top: 10px;\r\n}\r\n.desc{\r\n	padding-top: 20px;\r\n	padding-left: 10px;\r\n}\r\ntd input[type=\'text\']{\r\n	border:none;\r\n	width: 70%;\r\n	height:22px;\r\n	padding:6px 12px;\r\n	font-size:14px;\r\n	line-height:1.42857143;*/\r\n	color:#000;\r\n	border-bottom:2px solid;\r\n	margin-bottom: 10px;\r\n\r\n}\r\n.sublabel{\r\n	padding-left: 3%;\r\n}\r\n.declws{\r\n	font-size: 18px;\r\n	font-weight: bold;\r\n	text-transform: uppercase;\r\n	padding-top: 20px;\r\n	padding-bottom: 10px;\r\n	padding-left: 10px;\r\n}\r\n/* print preview table css*/\r\n	</style>\r\n\r\n<table id=\"jvv\" class=\"prev\">\r\n	<tr>\r\n		<td><img src=\"{logo}\" class=\"logo_left\" align=\"left\"></td>\r\n		<td>\r\n			<table class=\"prev1\">\r\n				<tr>\r\n					<td class=\"accrediate\">\r\n						{company_name}\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td  class=\"title_sw\">\r\n						<span class=\"locate\">Address :</span> {company_address}\r\n					</td>\r\n				</tr>\r\n			</table>\r\n		</td>\r\n		<td>\r\n			Form No :{form_no}<br><br> \r\n			Date    :{date}<br><br>\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<table class=\"prev2\" align=\"center\">\r\n			<tr>\r\n				<td class=\"mail\">\r\n					\r\n						<span class=\"locate\">E-mail :</span> {company_email}\r\n						<span class=\"locate\">Contact No :</span> {company_mob}\r\n					\r\n				</td>\r\n			</tr>\r\n			<tr class=\"thead\">\r\n				<td>\r\n					Admission form\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td  class=\"desc\">\r\n					\r\n					1. <span class=\"locate\" >Candidate Name :</span> (Name appears on your certificate is as given below)<br><br>\r\n					Full Name (IN BLOCK LETTER) :\r\n					 {student_full_name}<br><br>\r\n					<span class=\"sublabel\">Surname : {std_surname}</span>\r\n					<span class=\"sublabel\">Father Name : {std_father_name}<br><br></span>\r\n					2. <span class=\"locate\" >Date of Birth (DD/MM/YYYY) :</span>\r\n					{std_dob} <span class=\"locate\" >Age :</span>\r\n					{std_age}<br><br>\r\n					The following demographic information not required, but all information is appreciated.<br>\r\n					3. <span class=\"locate\">address :</span><br><br>\r\n					Temporary Address :\r\n						{std_temp_address}<br><br>\r\n					Permanant Address :\r\n						{std_perm_address}<br><br>\r\n					Postal code : \r\n						{std_pincode}\r\n					City : \r\n						{city_name}<br><br>\r\n					State/Province/country : \r\n						{state_name}<br><br>\r\n					4. <span class=\"locate\"> E-mail ID : </span>\r\n						{std_email_name}\r\n						Contact : {std_mob}<br><br>\r\n					5. <span class=\"locate\">Education : </span>\r\n						{education}<br><br>\r\n					6. <span class=\"locate\">occupation/job title :</span>\r\n						{occupation}<br><br>\r\n					7. <span class=\"locate\">Course :</span>\r\n						{course_name}<br><br>\r\n					8. <span class=\"locate1\"> Tickmark which vehicle type is learning ? (Please choose any)</span><br>\r\n						<label>\r\n							<input type=\"checkbox\" name=\"gender\" value=\"\"> Motor Cycle (With Gear or Without Gear)\r\n						</label><br>\r\n						<label>\r\n							<input type=\"checkbox\" name=\"gender\" value=\"\" > Light Vehicle Private/Non Transport</label>\r\n						<label><br>\r\n							<input type=\"checkbox\" name=\"gender\" value=\"\" > Light Vehicle Commercial/Transport\r\n						</label>\r\n						<label><br>\r\n							<input type=\"checkbox\" name=\"\"  value=\"\" >Heavy Motor Vehicle/ Transport Vehicle\r\n						</label>\r\n						<label><br>\r\n							<input type=\"checkbox\" name=\"gender\" value=\"\" > Non Transport /Transport\r\n						</label><br><br>\r\n				</td>\r\n			</tr>	\r\n			<tr><td>--------------------------------------------------------------------------------------------------------------------------------------------------------------------</td></tr>\r\n			<tr>\r\n				<td>\r\n					<span class=\"declws\">declaration :</span><br>\r\n					<textarea readonly=\"\" class=\"texton\" rows=\"4\">Our business has grown since then & Now we have many experienced driving instructors. We provide very comfortable & quality driving tuition for our customers not just to get their driving license but safe driving too for life.  We have facility of online driving Test for taking the appointment for driving Test.</textarea>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					<span class=\"declws\">affirmation :</span><br>\r\n					<textarea readonly=\"\" class=\"texton\" rows=\"6\">By submitting this form I accept the terms & conditions set for Adarsh Driving School Registration, Viva & Certification. I have read & understand above policies & agreed for registration.</textarea>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					<span class=\"locate\"> Date :</span>\r\n						____________________\r\n					<span class=\"signcol\">Signature :</span>\r\n						________________________\r\n					<span class=\"signcol\">Signature :</span>\r\n						________________________\r\n					<br><br><br>\r\n\r\n				</td>\r\n			</tr>\r\n		</table>\r\n	</tr>\r\n</table>', '2019-02-28 10:58:50', '2019-02-28 10:58:50');
